import React from 'react';
import Card from './Cards'
import Sdata from './Sdata';


console.log(Sdata[0].sname);
  
 const favSeries = 'netFlix';


 const FavS = ()=>{
  if(favSeries == 'netFlix'){
    return (
      <>
      <Card 
       key = {Sdata[1].id}
       imgsrc={Sdata[1].imgsrc}
       title={Sdata[1].title} 
       sname={Sdata[1].sname}
       link={Sdata[1].link}
      />

       <Card 
       key = {Sdata[0].id}
       imgsrc={Sdata[0].imgsrc}
       title={Sdata[0].title} 
       sname={Sdata[0].sname}
       link={Sdata[0].link}
      />
      </>
     );
     
   }else{
    return (
      <Card 
       key = {Sdata[2].id}
       imgsrc={Sdata[2].imgsrc}
       title={Sdata[2].title} 
       sname={Sdata[2].sname}
       link={Sdata[2].link}
      />
     );
   }
 }

 
 

const App = () =>{
    return(
    <>

    <h1>List og Top 5 Netflix in 2021</h1>
    <div className="flexBox">
   
   
   
     <FavS />
   
   
    </div>
    
   
   </>
    )
}

export default App;
